import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const TableComponent = ({ data }) => {
  return (
    <table className="table table-striped">
      <thead>
        <tr>
          <th>Position</th>
          <th>Team</th>
          <th>Crest</th>
          <th>Points</th>
          <th>Games Won</th>
          <th>Games Lost</th>
          <th>Goals For</th>
          <th>Goals Against</th>
          <th>Goal Difference</th>
        </tr>
      </thead>
      <tbody>

      </tbody>
    </table>
  );
};

export default TableComponent;
